import React, { useState, useEffect } from "react";
import { Navbar, Button, Table, Modal, ListGroup } from "react-bootstrap";
import { useNavigate } from "react-router-dom";
import Logo from "../../Images/Logo1.png";
import FileUpload from "./FileUpload";

function Manager() {
  const navigate = useNavigate();
  const [projects, setProjects] = useState<string[]>([]);
  const [showAvailableDevelopersModal, setShowAvailableDevelopersModal] = useState(false);
  const [developers, setDevelopers] = useState<string[]>([]);
  
  useEffect(() => {
    fetchProjects();
    fetchDevelopers();
  }, []);

  const fetchProjects = async () => {
    try {
      const response = await fetch("/api/getProjects");

      if (response.ok) {
        const data = await response.json();
        setProjects(data.projects);
      } else {
        console.error("Failed to fetch projects");
      }
    } catch (error) {
      console.error("Error fetching projects:", error);
    }
  };

  const fetchDevelopers = async () => {
    try {
      const response = await fetch("/api/getDevelopers");

      if (response.ok) {
        const data = await response.json();

        // Filter developers by user_type
        const developerNames = data.developers
          .filter((developer: { user_type: string; }) => developer.user_type === "developer")
          .map((developer: { name: any; }) => developer.name);

        setDevelopers(developerNames);
      } else {
        console.error("Failed to fetch developers");
      }
    } catch (error) {
      console.error("Error fetching developers:", error);
    }
  };

  const openAvailableDevelopersModal = () => {
    setShowAvailableDevelopersModal(true);
  };

  const closeAvailableDevelopersModal = () => {
    setShowAvailableDevelopersModal(false);
  };

  const handleLogout = () => {
    navigate("/");
  };

  return (
    <div>
      <Navbar>
        <img src={Logo} alt="Logo" className="logo-1" />
        <Button variant="transparent" className="logout-btn" onClick={handleLogout}>
          Logout
        </Button>
      </Navbar>

      {/* Sidebar */}
      <div className="sidebar">
        <ul>
          <li>Home</li>
          <li>Services</li>
          <li>Options</li>
          <li>About Us</li>
          <li>Contact Us</li>
        </ul>
      </div>

      {/* Projects Table */}
      <div className="projects-table">
        <h2>Projects</h2>
        <Table striped bordered hover>
          <thead>
            <tr>
              <th>Project Name</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {projects.map((projectName, index) => (
              <tr key={index}>
                <td>{projectName}</td>
                <td>
                  <Button variant="dark" size="sm" onClick={openAvailableDevelopersModal}>
                    Assign
                  </Button>
                </td>
              </tr>
            ))}
          </tbody>
        </Table>
      </div>

      {/* Available Developers Modal */}
      <Modal show={showAvailableDevelopersModal} onHide={closeAvailableDevelopersModal}>
        <Modal.Header closeButton>
          <Modal.Title>Available Developers</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <ListGroup>
            {developers.map((developer, index) => (
              <ListGroup.Item key={index}>{developer}</ListGroup.Item>
            ))}
          </ListGroup>
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={closeAvailableDevelopersModal}>
            Close
          </Button>
        </Modal.Footer>
      </Modal>
    </div>
  );
}

export default Manager;
